using log4net;
using Newtonsoft.Json;
using System;
using System.Net;
using System.Net.Http;
using System.Web.Http;
using Wow.CommonIllustrationService.Builders;
using Wow.CommonIllustrationService.Code;
using Wow.CommonIllustrationService.Properties;
using Wow.IllustrationCommonModels.Request;
using WOW.Illustration.Model.Generation.Response;

namespace Wow.CommonIllustrationService.Controllers
{
    public class IllustrationsController : ApiController
    {
        private static readonly ILog log = LogManager.GetLogger(typeof(IllustrationsController));

        private const string IllustrationPdf = "";

        [HttpPost]
        [ActionName("ProcessIllusRequest")]
        public HttpResponseMessage ProcessIllusRequest(IllustrationRequest illustrationRequest)
        {
            if (log.IsInfoEnabled) log.InfoFormat("Receiving JObject from client. Source IP Address: {0}.", Request.GetClientIpAddress());

            try
            {                
                // Call Validation factory
                RequestValidator.Validate(illustrationRequest);

                // Manufacture WIM object
                var wimObject = ConverterFactory.CreaterConverter(illustrationRequest);
                var wimjson = JsonConvert.SerializeObject(wimObject, Formatting.Indented);

                var winResponse = GenerateIllustration(wimObject);

                var response = new HttpResponseMessage { Content = new StringContent(winResponse.PdfFileAttachment) };
                
                return response;
            }
            catch (Exception ex)
            {
                if (log.IsErrorEnabled) log.Error("Error converting JSON IllustrationRequest to WIM.", ex);

                var errorResponse = Request.CreateErrorResponse(HttpStatusCode.InternalServerError, ex);
                throw new HttpResponseException(errorResponse);
            }
        }               

        internal WoodmenIllustrationResponse GenerateIllustration(WOW.Illustration.Model.Generation.Request.Policy policy)
        {
            if (log.IsInfoEnabled) { log.InfoFormat("Receiving Policy file upload from client. Source IP Address: {0}.", Request.GetClientIpAddress()); }

            try
            {
                // Create client object
                var client = new CommonWisClient();

                // Create new Woodmen Illustration Response
                var wowResponse = client.GetIllustration(policy);

                return wowResponse;
            }
            catch (Exception ex)
            {
                if (log.IsErrorEnabled) log.Error("Error processing illustration request.", ex);

                // Expected to get here while testing CIS to WIS flow
                if (Settings.Default.MockLpa)
                {
                    if (log.IsErrorEnabled) log.Info("Mocking LPA enabled to return default PDF response.");
                    var response = new WoodmenIllustrationResponse
                    {
                        PdfFileAttachment = IllustrationPdf
                    };
                    return response;
                }

                var errorResponse = Request.CreateErrorResponse(HttpStatusCode.InternalServerError, ex);
                throw new HttpResponseException(errorResponse);
            }
        }
        
        [HttpGet]
        [ActionName("TestHeartbeat")]
        public bool TestHeartbeat()
        {
            if (log.IsInfoEnabled) log.Info($"Common Illustration Service TestHeartbeat called by {Request.GetClientIpAddress()}.");
            return true;
        }

    }
}
